    false,nt"url": null,nt"notes": "This survey supports both Marine Mammal
    Protection Act (MMPA) with stock assessments and State Endangered Species Listing
    recovery objectives to regularly assess the status of the sea otter population in
    Washington. This survey effort is specifically identified in the Washington State
    Recovery Plan for the Sea Otter (Lance et al. 2004), with results used to gage progress
    toward the following delisting criteria: Sea otters will be considered for down
    listing from State Endangered to State Threatened status when: 1.t The average population
    level over a 3-year period equals or exceeds 1,640 sea otters in Washington, and
    2.t Washingtonu2019s sea otter population is distributed in areas outside the current
    range such that a single catastrophic event, such as a major oil spill, would be
    unlikely to cause severe decline or extirpation of the population.",nt"license_title":
